import { View, Text, StyleSheet } from "react-native";
import Login from "./Login";
import { Route, Routes } from "react-router-native";

const Main = () => {
  return (
    <View>
      <Routes>
        <Route path="/" element={<Login />} />
      </Routes>
    </View>
  );
};

export default Main;

const styles = StyleSheet.create({
  body: {
    fontFamily: "roboto-light",
  },
});
